import React from "react";
import SEO from "../common/SEO";
import {Link} from "react-router-dom";

import HeaderTopNews from '../common/header/HeaderTopNews';
import HeaderOne from '../common/header/HeaderOne';
import FooterTwo from '../common/footer/FooterTwo';
import Copyright from '../common/footer/Copyright';
import Slider from "react-slick";
import { BannerActivation } from "../utils/script";
import Separator from "../elements/separator/Separator";
import SectionTitle from "../elements/sectionTitle/SectionTitle";
import ServiceOne from '../elements/service/ServiceOne';
import AboutOne from '../elements/about/AboutOne';
import AboutTwo from '../elements/about/AboutTwo';
import AboutFour from '../elements/about/AboutFour';
import GalleryOne from "../elements/gallery/GalleryOne";
import TestimonialThree from "../elements/testimonial/TestimonialThree";
import BlogList from "../components/blog/itemProp/BlogList";
import BlogClassicData from '../data/blog/BlogList.json';
var BlogListData = BlogClassicData.slice(0, 3);

const BannerData = [
    {
        image: "images/service/waterways2.jpg",
        title: "Imagine checking into one hotel that transport you to all of the top destinations across Europe, with breaktaking scenery.",
        
    },
    {
        image: "images/bg/river-cruise.jpg",
        title: "Take control of how you want to travel.",
        description: "Drift away from strict itineraries",
    },
    {
        image: "images/service/exterior8.jpg",
        title: "Don't want to pay more for luxurious views, and breakfast?",
        description: "Well, don't. It's on us"
    },
    {
        image: "images/service/exterior8.jpg",
        title: "Even though travel therapy isn't covered by your insurance,",
        description: "We've got you covered as soon as you step foot onto the boat."
    }
]


const PopupData = [
    {
        id: "01",
        image: "images/service/leisure.png",
        linkText: "Leisure Traveler & Planning",
        link: "/Aquari/leisure-travel"
    },
    {
        id: "02",
        image: "images/service/calendar.png",
        linkText: "Business Traveler",
        link: "/Aquari/business-travel"
    },
   
]

const PopupData2 = [
    {
        id: "01",
        image: "images/service/parisandstuff.jpg",
        //linkText: "Meet our team and crew!"
        title: "Traveling is peace",
        description: "Here at Aquari we believe that traveling not only brings peace to our lives, but, in-turn it allows us to see people in a different perspective. Traveling allows you to expand your horizons, see how other people live their lives in these wonderful cultures that everyone deserves to experience. This understanding is the underlying cause for respect towards others and “peace” in this world."
    },
    
]

const TravelAgency = () => {
    return (
        <>
            <SEO title="Aquari" />
            <main className="page-wrapper">
                <HeaderOne btnStyle="btn-small" HeaderSTyle="header-transparent" />
                
                {/* Start Slider Area  */}
                <Slider className="slider-area slider-style-4 slider-dot rn-slick-dot rn-slick-arrow" {...BannerActivation}>
                    {BannerData.map((data, index) => (
                        <div key={index} className="single-slide">
                            <div className="height-950 bg_image" data-black-overlay="5" style={{backgroundImage: `url(${process.env.PUBLIC_URL}/${data.image})`}}>
                                <div className="container">
                                    <img className="home-logo" src={`${process.env.PUBLIC_URL}/images/service/aquari-full-white.png`} />
                                    <div className="row row--30 align-items-center">
                                        <div className="col-12">
                                            <div className="inner text-center">
                                                <h1 className="title" dangerouslySetInnerHTML={{__html: data.title}}></h1>
                                                <h1 className="title" dangerouslySetInnerHTML={{__html: data.description}}></h1>
                                                <a href={process.env.PUBLIC_URL + data.link}><p style={{color: "#43D9FA", textDecoration: "underline", textAlign: "center"}} className="description link" dangerouslySetInnerHTML={{__html: data.linkText}}></p></a>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    ))}
                </Slider>
                {/* End Slider Area  */}

                {/* Start Service Area  
                <div className="rn-service-area rn-section-gapBottom pt--100">
                    <div className="container">
                        <ServiceOne 
                        serviceStyle = "service__style--1 icon-circle-style"
                        textAlign = "text-center"
                        />
                    </div>
                </div>
                {/* End Service Area  */}
                <Separator />
                
                <AboutFour image="./images/blog/mountains.jpg" />

                
                {/* Start Elements Area  */}
                <div className="rwt-gallery-area rn-section-gapBottom">
                    <div className="container">
                        <div className="row mt_dec--30 row--15">
                            {PopupData2.map((item) => (
                                <div className="col-12 mt--30" key={item.id}>
                                    {/* images: 1270 x 950 */}
                                    <GalleryOne galleryItem={item} />
                                </div>
                            ))}
                        </div>
                    </div>
                </div>
                {/* End Elements Area  */}

                <Separator />
                {/* Start Elements Area  */}
                <h1 style={{marginBottom: "50px", textAlign: "center"}}>Traveling for business or leisure?</h1>
                <div className="rwt-gallery-area rn-section-gapBottom">
                    <div className="container">
                        <div className="row mt_dec--30 row--15">
                            {PopupData.map((item) => (
                                <div className="col-12 mt--30" key={item.id}>
                                    {/* images: 1270 x 950 */}
                                    <GalleryOne galleryItem={item} />
                                </div>
                            ))}
                        </div>
                    </div>
                </div>
                {/* End Elements Area  */}


               

                <Separator />
                <div className="rwt-gallery-area rn-section-gapBottom">
                    <div className="container">
                        <div className="row mt_dec--30 row--15">
                            
                            <div className="col-12 mt--30" key={"07"}>
                                {/* images: 1270 x 950 */}
                                <div className="rn-gallery icon-center">
                                    <div className="thumbnail">
                                        <img className="radius-small" src={`${process.env.PUBLIC_URL + '/images/service/closing.png'}`} alt="Corporate Image" />
                                    </div>
                                </div>
                            </div>
                           
                        </div>
                    </div>
                </div>
                 
               {/*} <FooterTwo /> */}
                <Copyright />
            </main>
        </>
    )
}

export default TravelAgency;
